import React from "react";
import { AppBar, Toolbar, Grid, Button } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

import { MuiThemeProvider } from "@material-ui/core/styles";
import { theme } from "../theme";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  logo: {
    maxWidth: 60,
    marginRight: theme.spacing(1),
  },
  left: {},
  Toolbar: {
    minHeight: 128,
    alignSelf: "flex-start",
  },
  copyright: {
    alignSelf: "flex-end",
  },
}));

const Header = () => {
  const classes = useStyles();

  return (
    <div>
      <MuiThemeProvider theme={theme}>
        <AppBar className={classes.appBar} position="static">
          <Toolbar>
            {/* <Grid container alignItems="center" justify="center"> */}
            {/* <Grid item xs={6} className={classes.left}> */}
            <Button color="inherit">ゲーム一覧</Button>
            <Button color="inherit">ブログ</Button>
            <Button color="inherit">お問い合わせ</Button>
            {/* </Grid> */}
            <p className={classes.copyright}>© 2020 Copyright: Dabyss</p>
            {/* <Grid item xs={6} className={classes.right}> */}
            <Button color="inherit">LINE</Button>
            <Button color="inherit">Twitter</Button>
            <Button color="inherit">Instagram</Button>
            {/* </Grid> */}
            {/* </Grid> */}
          </Toolbar>
        </AppBar>
      </MuiThemeProvider>
    </div>
  );
};

export default Header;
